import React, { Fragment } from "react";
import Header from "./Header";
import Footer from "./Footer";
import "./Home.scss";
import image1 from "../assets/landingImage1.png";

const Body = () => (
  <div className="main">
    <div className="firstDiv">
      <div className="topTextContainer">
        <h2 className="topLefttext1">
          SAVE IN BITS <br />
          EVERY
          {/* <h1 style={{ backgroundColor: "#F2C438" }}> */}
          TIME YOU SPEND.
          <br /> EARN DOLLARS DAILY.
        </h2>
        <h4>
          Take the stress out of your savings. Get to round off your everyday
          spendings and save in bits whenever you spend, investing them to grow
          daily in dollars.
        </h4>
      </div>
      {/* <div className="topRightDiv">

      </div> */}
      <img
        src={image1}
        alt="landingImage1"
        loading="lazy"
        width="500"
        height="600"
      ></img>
    </div>

    <div className="rowDiv">
      <div className="rowDiv1">A</div>
      <div className="rowDiv2">B</div>
      <div className="rowDiv3">C</div>
    </div>
  </div>
);

function Home() {
  return (
    <Fragment>
      <Header />
      <Body />
      <Footer />
    </Fragment>
  );
}

export default Home;
